"""
Write a function:
    class Solution {public int solution(int[] A);}
that, given an array A consisting of N integers, returns the maximum sum of two numbers
whose digits add up to an equal sum. if there are no two numbers whose digits have an equal sum,
the function sholud return -1

Example1:
     1. Given A = [51, 71, 17, 42], the function should return 93. there are two paris of numbers
     whose digits add up to an euqal sum: (51, 42) 5+1=4+2 and (17, 71) 1+7=7+1. the first pair sums up to 93
Example2:
    A = [42, 33, 60]
    Output: 102
    Explanation: The digits of all numbers in A add up the same sum, and choosng to add 42 and 60 gives the result 102
Example3:
    Input:
    A = [51, 32, 43]
    Output: -1
    Explanation: All numbers in A have digits that add up to different, unique sums

N is integer within the range [1, 200000]
each element of array A is an integer within the range [1, 1000000000]
"""

from typing import List
from functools import reduce
from collections import defaultdict

import cProfile


class Solution:
    def maxValOfNumWithEqualDigitSum(self, A: List[int]) -> int:
        """
        time complexity: O(N)
        space complexity: O(N)
        """
        if not A:
            return -1
        val_dict = defaultdict(list)
        for a in A:
            digit_sum = self.get_digit_sum(a)
            val_dict[digit_sum].append(a)

        ans_list = [ans for ans in val_dict.values() if len(ans) >= 2]
        return max(sum(l) for l in ans_list)

    def get_digit_sum(self, num):
        # val = 0
        # while num:
        #     val += num % 10
        #     num //= 10
        # return val
        return reduce(lambda x, y: int(x) + int(y), str(num))


